import React from "react";
import "./weekData.css";
import { useContext } from "react";

function WeekData() {
  const data = useContext(WeeklyInfoContext);
  return (
    <div>
      <p>week information</p>
      <p>{data.weekStartDate}</p>
      <p> to </p>
      <p>{data.weekEndDate}</p>
    </div>
  );
}

export default WeekData;
